import React from 'react';
import Register from './component/Register';
import {
  Box,
  Grid,
} from '@chakra-ui/react';
import { ColorModeSwitcher } from './ColorModeSwitcher';


function App() {
  return (
    <>

      <Box textAlign="center" fontSize="xl">
      <Grid minH="100vh" p={3}>
      <Register />
      <ColorModeSwitcher justifySelf="flex-end" />
      </Grid>
      </Box>
      </>
  );
}

export default App;
